import net.sf.json.groovy.*;

def items = context.expand( '${Display product confirmation business interaction items and return items#res_items}' )
def child1SerializedProductId = context.expand( '${Create related products#res_child1SerializedProductId}' )
def child2SerializedProductId = context.expand( '${Create related products#res_child2SerializedProductId}' )
def parentSerializedProductId = context.expand( '${Create related products#res_parentSerializedProductId}' )

def json = new JsonSlurper().parseText (items);

for (int i=0; i < json.size(); i++){

	if (json[i].productId == child1SerializedProductId ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("child1_ItemId",json[i].id.toString());

										}

	if (json[i].productId == child2SerializedProductId ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("child2_ItemId",json[i].id.toString());

										}

	if (json[i].productId == parentSerializedProductId ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("parent_ItemId",json[i].id.toString());
		
	
																		
}}

